import React from 'react';
import {Link} from 'react-router-dom';

function HomeButton(){
    return (
        <Link style={{ fontFamily: 'Ubuntu-Italic' ,textDecoration: 'none', color: 'black', fontSize: '3em' }} className="homeLink" to='/'>
            <img className="logoImage" alt="datastructs logo" src={require("../resources/images/project-diagram-solid.svg")}/>
            DataStructs
        </Link>
    );
}

export default HomeButton;
